import PatientList from "./components/PatientList"
import './App.css';

function App() {
  return (
    <header classN="header">
      <div classN="brand-box">
        <span classN="brand">Shree Krishna Hospital</span>
      </div>

      <div classN="text-box">
        <h1 classN="heading-primary">
          <span classN="heading-primary-main">Heading Primary Main</span>
          <span classN="heading-primary-sub">The secondary heading</span>
        </h1>
        <a href="#" classN="btn btn-white btn-animated">Discover our tours</a>
      </div>
    </header>
  );
}

export default App;
